import React from 'react';
import styled from 'styled-components';

type jumboProps = {
    content: string;
    header: string;
}

const Content = styled.section`
    background-color: #237c7e;
    height: 600px;
    text-align: left;
    width: 100%;

    h3{
    },
    p {
      font-size: 18px;
    }
`;

const Jumbo: React.FC<jumboProps> = (props) => {
    return <Content>
        <h3>{props.header}</h3>
        <p>{props.content}</p>
        </Content>
};

Jumbo.defaultProps = {
    header: 'Header Jumbo',
    content: 'This is the Blockquote content'
};

export default Jumbo;
